void softmax(int8_t* fc_out, uint8_t* softmax_out){
    float softmax_inter[4] = {0};
    int64_t softmax_inter_shape[2] = {1,4};

    for(int i = 0; i<4; i++){
        softmax_inter[i] = fc_out[i] - 28;
        softmax_inter[i] *= 0.15586692094802856;
    }

    float x_max = -FLT_MAX;
    for(int i = 0; i<4; i++){
        x_max = softmax_inter[i] > x_max ? softmax_inter[i] : x_max;
    }

    float exp_sum = 0.0;
    for(int i =0; i < 4 ; i++){
        softmax_inter[i] = exp(softmax_inter[i] - x_max);
        exp_sum += softmax_inter[i];
    }

    for(int i=0; i<4; i++){
        softmax_inter[i] /= exp_sum;
        softmax_inter[i] /= 0.00390625;
        softmax_inter[i] = round(softmax_inter[i]) - 128;
        softmax_inter[i] = softmax_inter[i] < -128 ? -128 : softmax_inter[i] > 127 ? 127 : softmax_inter[i];

        //Convert to uint8
        softmax_inter[i] += 128;
        softmax_out[i] = softmax_inter[i] < 0 ? (uint8_t)0 : softmax_inter[i] > 255 ? (uint8_t)255 : (uint8_t)softmax_inter[i];
    }
    
}

